function onload() {
var canvas = document.getElementById('myImage');
var ctx = canvas.getContext('2d');
myImage = new Image();
myImage.onload = function() {
  var xpos = 300; // the x position of the center of the image
  var ypos = 200; // the y position of the center of the image
  ctx.save(); // save the current state of the canvas context
  ctx.translate(xpos, ypos);
  ctx.rotate(90 * Math.PI / 180); // rotate by 47 degrees and convert to radians
  ctx.translate(-xpos, -ypos);
  ctx.drawImage(myImage, xpos - myImage.width / 2, ypos - myImage.height / 2);
  ctx.restore(); // restore the previous state of the canvas context
}
myImage.src = "data:image/jpeg;base64,";

var xdata = canvas.toDataURL("image/jpeg");
alert(xdata);
$('#result').attr({ 
	src: xdata,
	title: "blank"
});


}
